import React from 'react';
import '../styleesheets/Dashboard.css';

function Proveedores() {
    return (
        <main>
        <div className='dashboard-titulo'>
            <h1>
                Proveedores
            </h1>
        </div>
            <div className='datos-proveedores'>
                <h1>Registrar Proveedores</h1>
                <label>Razon Social: <input type='text'/> </label>
                <label>Direccion: <input type='text'/> </label>
                <label>Telefono: <input type='text'/> </label>
                <label>Rut: <input type='text'/> </label>
                <label>Banco: <input type='text'/> </label>
                <label>Numero Cuenta: <input type='text'/> </label>
                <label>Tipo Cuenta: <input type='text'/> </label>
            </div>
    </main>
    );

}

export default Proveedores;
